.cls-1{fill:#082c60;}.cls-2,.cls-5{fill:none;}.cls-3{isolation:isolate;}.cls-4{fill:#fff;}.cls-5{stroke:#fff;stroke-linecap:round;stroke-linejoin:round;stroke-width:2.76px;stroke-dasharray:5.52;}.cls-6{fill:#f4f4f4;}.cls-7{fill:#cdccd2;}.cls-8{clip-path:url(#clip-path);}.cls-9{fill:#274f89;}.cls-10{fill:#699dd1;}.cls-11{fill:#cccdcf;}.cls-12{fill:#b70083;}.cls-13{fill:#7dc3ea;}.cls-14{fill:#f4c023;}.cls-15{fill:#d4ecff;}.cls-16{fill:#ff2c9c;}.cls-17{fill:#ffbc0d;}.cls-18{fill:#86b8e0;}.cls-19{fill:#d2ebfe;}.cls-20{fill:#d3008d;}.cls-21{clip-path:url(#clip-path-2);}.cls-22{opacity:0.23;mix-blend-mode:overlay;}.cls-23{fill:#fff9f3;}.cls-24{fill:#5765ec;}.cls-25{fill:#efe4da;}.cls-26{fill:#fff2cf;}.cls-27{fill:#350d65;}.cls-28{fill:#172133;}.cls-29{fill:#3fc9ee;}.cls-30{fill:#fea501;}.cls-31{fill:#ff5a00;}
</style>

<script>
import Swipe from '@/components/_swipe'
	export default {
		components: {
			Swipe
		},
		mounted() {
			this.mobileBanner
		},
		computed: {
			mobileBanner() {
				let rightHand = new TimelineMax({yoyo:true,repeat:-1});
                	rightHand
         				.to("#hand-right", 0.5, {x:25,y:-10, ease:Power1.easeInOut})
         				.to("#hand-right", 0.5, {x:-10,y:-25, ease:Power1.easeInOut})
         				.to("#hand-right", 0.5, {x:-10,y:-45, ease:Power1.easeInOut})
         				.to("#hand-right", 0.5, {x:25,y:-45, ease:Power1.easeInOut})
         				.to("#hand-right", 0.5, {x:25,y:0, ease:Power1.easeInOut})
         				.to("#hand-right", 0.5, {x:100,y:-40, ease:Power1.easeInOut})
         				.to("#hand-right", 0.75, {x:150,y:-60, ease:Power1.easeInOut})
         				.to("#mouse", 0.75, {x:50,y:-20, ease:Power1.easeInOut},"-=0.75")

                let leftHand = new TimelineMax({yoyo:true,repeat:-1});
                	leftHand
         				.to("#hand-left", 0.5, {x:-25,y:10, ease:Power1.easeInOut})
         				.to("#hand-left", 0.5, {x:-25,y:20, ease:Power1.easeInOut})
         				.to("#hand-left", 0.5, {x:-10,y:45, ease:Power1.easeInOut})
         				.to("#hand-left", 0.5, {x:25,y:0, ease:Power1.easeInOut})
         				.to("#hand-left", 0.5, {x:-10,y:0, ease:Power1.easeInOut})
         				.to("#hand-left", 0.5, {x:-20,y:45, ease:Power1.easeInOut})

         		let codeWriting = new TimelineMax({repeat:-1});
                	for (let rq = 0; rq <= 46; rq++) {
                	 	codeWriting.from("#_" + rq, 0.1, {scaleX: 0, transformOrigin: "left"})
                	 }
                	codeWriting.to("#code", 0.25, {x: 55, opacity:0})

                let mobileBanner = new TimelineMax();
					mobileBanner
						.add(rightHand,0)
						.add(leftHand,0)
						.add(codeWriting,0)

				return mobileBanner 
			}
		}
	}
</script>
